import React from 'react';
import './social-share.css';


const facebook = "data:image/png;base64,";
const instagram = "https://upload.wikimedia.org/wikipedia/commons/thumb/e/e7/Instagram_logo_2016.svg/768px-Instagram_logo_2016.svg.png";
const telegramm = "https://upload.wikimedia.org/wikipedia/commons/thumb/e/ef/Telegram_X_2019_Logo.svg/1024px-Telegram_X_2019_Logo.svg.png";
const vk = "https://lh3.googleusercontent.com/proxy/y_hQiULxWcUXdQL8MPVYfgzi--wc9_Y0J0KXHqLnBzl70qaobN_Bf2Gx7xMdNcQ5Snj2pZRKrQeVsKTVLact-LOwZaP6oJwlf0oTOur3f0YJp7hfZ02SrBMrBEAR3bilJhg";

const SocialShare = () => {
    return (
        <div className="social">
            <ul>
                <li><a href="http://facebook.com"><img alt="face" src={facebook} /></a></li>
                <li><a href="https://www.instagram.com"><img alt="insta" src={instagram} /></a></li>
                <li><a href="https://telegram.org"><img alt="telega" src={telegramm} /></a></li>
                <li><a href="http://vk.com"><img alt="vk" src={vk} /></a></li>
            </ul>
        </div>
    )
}

export default SocialShare;
